import unittest
import random
from algoritmit.jps import Jps
from algoritmit.dijkstra import Dijkstra


class TestJps(unittest.TestCase):
    def setUp(self):
        self.jps = Jps(None)
        self.dijkstra = Dijkstra(None)
        self.alku = None
        self.loppu = None

    def test_tapaukset(self):
        for i in range(100):
            kartta = self.nollaa_kartta()
            self.dijkstra = Dijkstra(kartta)
            self.jps = Jps(kartta)
            self.dijkstra.reitinhaku()
            self.jps.reitinhaku()
            print(
                f"Solmujen koordinaatit: Alku: {self.alku}, Loppu: {self.loppu}")
            self.assertEqual(f"{self.dijkstra.loppusolmu.etaisyys:.2f}",
                             f"{self.jps.loppusolmu.etaisyys:.2f}")

